import React from "react";
import web from "../src/images/landing.png";
import Common from "./Common";
import Aos from "aos";

const Home = () => {
  return (
    <>
      <Common
        name="Grow your business with"
        imgsrc={web}
        visit="/service"
        btname="Get Started"
        data-aos=""
      />
    </>
  );
};

export default Home;
